pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract TokenSwap {

    address payable private _slgOwnerAddress;
    IERC20 private _slgToken;

    constructor (ERC20 token) public {
        _slgToken = token;
        _slgOwnerAddress = payable(msg.sender);
    }

    function swapETH() public payable {
        _slgOwnerAddress.transfer(msg.value);
        _slgToken.transferFrom(_slgOwnerAddress, msg.sender, msg.value * 3);
    }

    function swapOtherTokens(address _token, uint _amount) public {
        ERC20 token = ERC20(_token);
        uint256 amount = _amount * 10 ** 18;

        require(
            token.allowance(msg.sender, address(this)) >= amount,
            "You did not approve enough amount"
        );

        require(
            _slgToken.allowance(_slgOwnerAddress, address(this)) >= amount * 2,
            "Do not have enough Shen Long"
        );

        bool sent = token.transferFrom(msg.sender, _slgOwnerAddress, amount);
        require(sent, "Token transfer failed");

        sent = _slgToken.transferFrom(_slgOwnerAddress, msg.sender, amount * 2);
        require(sent, "Token transfer failed");
    }
}
